 import "./styles/App.css"

import Navbar from './components/box/Navbar';
// import Header from './components/box/Header/Header';
import Footer from './components/box/Footer';
import Home from './components/pages/gen/Home'
import SignIn from './components/pages/auth/SignIn';
import SignUp from './components/pages/auth/SignUp';
import EmailLogIn from './components/pages/auth/EmailLogIn';
import UserProfile from './components/pages/suite/UserProfile';
import DataHub from './components/items/hubs/DataHub'
import Error from './components/pages/gen/error';

import { Route, Switch } from 'react-router-dom';
import { useEffect } from 'react';
import useAxiosFetch from './hooks/useAxiosFetch';
import { useStoreActions } from 'easy-peasy';

function App() {

    // CODE TO LOAD DATA

    const setStories = useStoreActions((actions) => actions.setStories);
    // const setUsers = useStoreActions((actions) => actions.setUsers);
    const { storyData, storyFetchError, storyIsLoading } = useAxiosFetch('http://localhost:3500/stories');
    // const { userData, userFetchError, userIsLoading } = useAxiosFetch('http://localhost:3500/users');

    useEffect(() => {
        setStories(storyData);
    }, [storyData, setStories]);
    // useEffect(() => {
    //     setUsers(userData);
    // }, [userData, setUsers])

    return (
        <div className="App">
            {/* <Header title="Web Services App"/> */}
            <Navbar />
                <Switch>
                   <Route path="/" component={Home} /> 
                   <Route path="/signIn" component={SignIn} />
                   <Route path="/signUp" component={SignUp} />
                   <Route path="/emailLogIn" component={EmailLogIn} />
                   <Route path="/signUp" component={SignUp} />
                   <Route exact path="/userProfile">
                        <UserProfile 
                            // userIsLoading={userIsLoading}
                            // userFetchError={userFetchError}
                            storyIsLoading={storyIsLoading}
                            storyFetchError={storyFetchError}
                            /> 
                    </Route>
                   <Route path='/dataHub' component={DataHub} />
                   <Route path="*" component={Error} />
                </Switch>
            <Footer />
        </div>
    )
    };

export default App;
